  [],\n\t\"revision_timestamp\": \"2015-05-06T21:40:13.848683\",\n\t\"name\": \"reliable-high-performance-processing-system-rhpps-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NASA's exploration, science, and space operations
  systems are critically dependent on the hardware technologies used in their implementation.
  \ Specifically, the performance and deployment of autonomous and computationally-intensive
  capabilities for space based observatories, orbiters, autonomous landing and hazard
  avoidance, autonomous rendezvous and capture, robotic, relative navigation, command,
  control and communications systems are directly dependent on the availability of
  radiation-tolerant, high-performance, reconfigurable and adaptable, energy-efficient
  processor technology.rnrnCoherent Logix, Incorporated proposes to develop a radiation
  tolerant HyperX technology based processor to address these critical needs.  This
  program will leverage more than $18M investment by the Department of Defense to
  bring this technology to the Warfighter.  The Phase 1 program will outline radiation
  hardened by design (RHBD) and/or radiation hardened by process (RHBP) approach.
  \ This will be followed in Phase 2 and Phase 3 by the design, development, and productization
  to a TRL 8/9 of a Radiation Tolerant HyperX Processor.rn\",\n\t\"license_title\":
